import React from "react";

import "./Users.scss";

const Users = () => {
    return (
        <div className="root-users">
            <div className="user">
                <div className="logo"></div>
                <input type="text" value="Ann Li" />
                <input type="text" value={20000} />
                <input type="button" value="r" />
                <input type="button" value="d" />
            </div>
        </div>
    );
};

export default Users;
